import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle';
import './tailwindStyles/tailwind.css';

const App = () => {
  return (
    <div>
      <Router />
      <SpeedInsights>Your SpeedInsights Component Here</SpeedInsights>
    </div>
  );
};

export default App;
